window.bookSummaryJSON = "<p>Come meet Max. She's brash. She's inked. She has a bad habit of dying... a lot.</p> <p>She's also a Rogue with a demon on her tail and not much backup. This witch has a bone to pick.</p> <p>I was burned at the stake at fourteen...</p> <p>I was drowned in a lake when I was twenty-four...</p> <p>At twenty-seven, I was stoned in a public square...</p> <p>I have died a hundred times in a hundred different ways, usually at the hands of the humans I've tried to save. But when a pregnant young woman finds her way into my tattoo shop with a demon on her tail, things go from bad to worse. Being a centuries-old witch isn't going to help meâ€”nothing will.</p> <p>This time I might just die in a way that sticks. Permanently.</p> <p>The Rogue Ethereal Complete Series contains all six books in this thrilling urban fantasy series.</p>"; 
